// ==UserScript==
// @name         AMQ Voice Universal
// @namespace    https://github.com/43D
// @version      0.1
// @description  Voice
// @author       43D
// @match        https://animemusicquiz.com/
// ==/UserScript==

if (document.getElementById("startPage")) return;

let loadInterval = setInterval(() => {
    if (document.getElementById("loadingScreen").classList.contains("hidden")) {
        init();
        clearInterval(loadInterval);
    }
}, 500);

const body = document.getElementsByTagName("body")[0];
let modal;

var v;
var x = true;

var lastGain;
var xpIntoLevel;

// SET VOICE LINES

var morning = new Audio("data:audio/mpeg;base64,");
var afternoon = new Audio("data:audio/mpeg;base64,");
var evening = new Audio("data:audio/mpeg;base64,");
var night = new Audio("data:audio/mpeg;base64,");
var join = new Audio("data:audio/mpeg;base64,");
var leave1 = new Audio("data:audio/mpeg;base64,");
var leave2 = new Audio("data:audio/mpeg;base64,");
var start1 = new Audio("data:audio/mpeg;base64,");
var start2 = new Audio("data:audio/mpeg;base64,");
var arigato = new Audio("data:audio/mpeg;base64,");
var roll = new Audio("data:audio/mpeg;base64,");
var popout = new Audio("data:audio/mpeg;base64,");
var message = new Audio("data:audio/mpeg;base64,");
var settings = new Audio("data:audio/mpeg;base64,");

var now = new Date();
var heure = now.getHours();

// LOGIN VOICE LINE BASED ON TIME

if (heure >= 8 && heure < 12) {
    morning.volume = 0.70;
    morning.play()
}
else if (heure >= 12 && heure < 18) {
    afternoon.volume = 0.70;
    afternoon.play()
}
else if (heure >= 18) {
    evening.volume = 0.70;
    evening.play()
}
else if (heure >= 0 && heure < 8) {
    night.volume = 0.70;
    night.play()
}

function init() {
    setup();
    interface();
}

function setup() {
    // When User join a game
    let JoinGame = new Listener("Join Game", (payload) => {
        join.volume = 0.70;
        join.play()
    });
    // When another Player leave
    let PlayerLeft = new Listener("Player Left", (payload) => {
        if (x == true) {
            leave1.volume = 0.70;
            leave1.play()
            x = false;
        }
        else {
            leave2.volume = 0.70;
            leave2.play()
            x = true;
        }
    });
    // When the game start
    let GameStart = new Listener("Game Starting", (payload) => {
        if (x == true) {
            start1.volume = 0.70;
            start1.play()
            x = false;
        }
        else {
            start2.volume = 0.70;
            start2.play()
            x = true;
        }
    });
    // When rolling for skins
    let TicketRoll = new Listener("ticket roll result", (payload) => {
        roll.volume = 0.70;
        roll.play()
    });
    // When leveling up
    let LevelUp = new Listener("quiz xp credit gain", (payload) => {
        var lastGain = data.xpInfo.lastGain;
        var xpIntoLevel = data.xpInfo.xpIntoLevel;
        if (lastGain > xpIntoLevel) {
            arigato.volume = 0.90;
            arigato.play()
        }
    });
    // When there is a popout
    let Popout = new Listener("popout message", (payload) => {
        popout.volume = 0.70;
        popout.play()
    });
    // When changing room settings
    let Setting = new Listener("Room Settings Changed", (payload) => {
        settings.volume = 0.70;
        settings.play()
    });
    // When receiving DM
    let Message = new Listener("chat message", (payload) => {
        message.volume = 0.70;
        message.play()
    });
    // When receiving friend request
    let FriendRequest = new Listener("new friend request recived", (payload) => {
        message.volume = 0.70;
        message.play()
    });
    // When receiving game invite
    let GameInvite = new Listener("game invite", (payload) => {
        message.volume = 0.70;
        message.play()
    });

    JoinGame.bindListener();
    PlayerLeft.bindListener();
    GameStart.bindListener();
    TicketRoll.bindListener();
    LevelUp.bindListener();
    Popout.bindListener();
    Setting.bindListener();
    Message.bindListener();
    FriendRequest.bindListener();
    GameInvite.bindListener();
}

function interface() {
    modalSettings();
    buttonSettings();
}

function modalSettings() {
    modal = modalFactory().get();
}

function buttonSettings() {
    let div = document.createElement("div");
    let btn = document.createElement("button");
    btn.innerHTML = "Voice Settings";
    div.style.position = "absolute"
    div.style.bottom = "50px";
    div.style.zIndex = "9999999";
    btn.style.color = "white";
    btn.style.backgroundColor = "#1b1b1b";
    btn.style.fontSize = "14pt";
    btn.style.width = "200px";
    btn.style.height = "40px";
    btn.onclick = () => { openModal() };
    div.appendChild(btn);
    body.appendChild(div);
}

function openModal() {
    modal.style.display = "block";
}
function closeModal() {
    modal.style.display = "none";
}

function modalFactory() {

    let modal = document.createElement("div");

    init();

    function init() {
        styleDiv();
        let div2 = document.createElement("div");
        div2.style.margin = "50px";
        div2.style.fontSize = "15pt";
        div2.appendChild(createTitle());
        div2.appendChild(createHr());
        //div2.appendChild(createConteudo());
        div2.appendChild(createFooter());
        modal.appendChild(div2);
        body.appendChild(modal);
    }

    function styleDiv() {
        modal.style.position = "absolute"
        modal.style.width = "700px";
        modal.style.height = "100vh";
        modal.style.zIndex = "999999999";
        modal.style.right = "calc(50% - 350px)";
        modal.style.backgroundColor = "#1b1b1b";
        modal.style.color = "white";
        modal.style.overflowX = "hidden";
        modal.style.overflowY = "scroll"
        modal.style.whiteSpace = "nowrap";
        modal.style.display = "none";
        modal.id = "modalVoice"
    }

    function createTitle() {
        let div = document.createElement("div");
        div.style.display = "flex";
        div.style.justifyContent = "space-around";

        let h3 = document.createElement("div");
        h3.innerHTML = "Voice Settings";

        let btn = document.createElement("button");
        btn.style.backgroundColor = "#00000000";
        btn.style.color = "#fff";
        btn.style.border = "0px";
        btn.style.fontSize = "20pt";
        btn.innerHTML = "X";
        btn.onclick = () => { closeModal() };

        div.appendChild(h3);
        div.appendChild(btn);
        return div;
    }

    function createHr() {
        let hr = document.createElement("hr");
        return hr;
    }

    function createConteudo() {
        return;
    }

    function createFooter() {
        let div = document.createElement("div");
        div.style.display = "flex";
        div.style.justifyContent = "center";

        let btn = document.createElement("button");
        btn.style.fontSize = "25pt";
        btn.style.color = "black";
        btn.innerHTML = "Fechar";
        btn.onclick = () => { closeModal() };

        div.appendChild(btn);
        return div;
    }

    function get() {
        return modal;
    }

    return {
        get
    }
}